import React from 'react'

const ScoreCard = (props) => {

    let timeStr = props.created_at
    let date = new Date(timeStr)

    return (
        <div>
            <p>You scored {props.score}</p>
            <p>{date}</p>
        </div>
    )

}

export default ScoreCard
